import React, {useEffect, useState} from 'react';
import axios from "axios";

const HeaderAdmin = () => {
    const [user,setUser]=useState()
    useEffect(() => {
        axios.get('http://localhost:8000/users/me',{
            headers: {
                'accept': 'application/json'
            },
            withCredentials: true
        }).then((res)=>console.log(res.data))
    }, []);
    return (
        <div
            className="w-[1440px] h-16 px-[15px] bg-white rounded-b-[14px] justify-start items-center gap-[276px] inline-flex mx-[200px]">
            <div className="h-10 justify-start items-center gap-2.5 flex ml-[5px]">
                <div className="w-10 h-10 ">
                    <img className="w-[60px] h-10 rounded-full" src={"127.0.0.1/img/?path+"+user.photo}/>
                </div>
                <div
                    className="w-[150px] h-[26px] text-black text-xl font-medium font-['Roboto'] leading-[30px] tracking-tight">{user.username}
                </div>
                <div className="w-6 h-6 px-[7px] justify-center items-center flex"/>
            </div>
        </div>
    );
};

export default HeaderAdmin;
